import {Link} from "react-router-dom"

const Nav=()=>{
    return(
        <div>
            <ul>
                <li><a href="default.asp">Home</a></li>
                <li><a href="news.asp">News</a></li>
            </ul>
        </div>
    )
}
export default Nav
